                            Description = "Green buildings can be categorized by two key factors. One is to design a workspace that functions sustainably, utilizing supplies and techniques that respect the environment and effectively utilize resources.\n\nThe second is to develop a structure that complements the environment in which it is situated, without detracting from it; in fact, it should enhance its surroundings. We can only anticipate that this tendency will continue as the future of sustainable buildings is promising and expanding.\n\nBy orienting buildings for the optimum natural light and ventilation, sustainable sites seek to protect ecosystems, vegetation, biodiversity, and human influences that are detrimental to the environment. Constructing in such regions that are easily accessible to services and public transportation can save energy on air conditioning and lighting while avoiding the need for a car.\n\nBy using recycled, renewable, eco-friendly, or responsibly sourced materials as much as possible, materials & resources ensure that the materials used in the building require less energy during manufacturing. Construction waste materials should be reused and the building’s design should be optimized to use the fewest amount of resources possible.\n\nThe building’s energy demand should be kept to a minimum, and renewable and alternative energy sources should be employed, helping to reduce carbon emissions while the structure is in operation, energy efficiency demands detailed energy modeling of the to-be-built structure using digital tools.\n\nUsing clean energy and natural lighting while making the most of locally available resources and improving the quality of life for those who live there is what it means to construct a structure in this way. This provides advantages for all residents’ mental health as well as cleaner air and a nicer environment.\n\nThus, green buildings offer their inhabitants far more advantages than only natural green spaces. 