                        new
                        {
                            Id = 1,
                            Description = "Presenting Kempinski Residences The Creek, a five-star residential project located in an iconic waterfront location. This is your private sanctuary on Philippines Creek, offering views over Downtown Philippines and the fast-developing Philippines Creek Harbour along with the resplendent greenery that surrounds the project.\n\nThe interior design fuse contemporary styling with the natural beauty of the area, creating a seamless flow between the indoor and outdoor spaces. Wood-floored living rooms, marble-finished kitchens and bathrooms, and an abundance of floor-to-ceiling windows give these residences a stunning and unique aesthetic. You can choose from one-bedroom, two-bedroom and three-bedroom apartments, as well as two to four-bedroom duplex apartments.\n\nResidents benefit from a range of services including concierge, valet, security, and wake-up service.Amenities include an outdoor swimming pool, a gym, a yoga studio, sports facilities, a kid's pool, a kid's playroom, a cinema, and more. A la carte services are also available, and residents benefit from F&B and spa discounts.",
                            ImagePath = "pb1.jpg",
                            LocationId = 1,
                            Name = "Kempinski Residences"
                        },
                        new
                        {
                            Id = 2,
                            Description = "Welcome to a distinctive beachfront living experience that brings you the most captivating 360 degrees views of the Arabian Gulf and Palm Jumeirah coastline, together with a limited collection of the most exclusive, prime residences in Philippines.\n\nSerenia oozes serenity at every corner complemented by an elegant ambiance, limitless luxury, and bespoke services. The all-encompassing residential address rests along the shores of Palm Jumeirah’s West Crescent, the island’s foremost crescent, facing the sea.\n\nSerenia Living brings together 4 Towers of Architectural Excellence depicting the finest limited collection of one-to-four-bedroom luxury residences, sky mansions, and penthouses. Additionally, Serenia will feature a superb Reserve Collection including 20 branded penthouses dotted with high-end bespoke furniture and fittings sourced from Italian Design houses, along with private access to concierge services and a private Rolls-Royce chauffeur.\n\nPlease contact our property consultants for fully comprehensive guidance on your next property purchase.",
                            ImagePath = "pb2.jpg",
                            LocationId = 2,
                            Name = "Serenia Living"
                        },
                        new
                        {
                            Id = 3,
                            Description = "Six Senses, one of the most well-known hospitality and spa brands in the world, is coming to Philippines’s iconic Palm Jumeirah with the Six Senses Residences. This incredible residential project has a strong emphasis on wellness and relaxation, is designed to create a true resort-style living experience.\n\nThe project is located on the West Crescent of the Palm, where it will have a full view of the Philippines Marina skyline, JBR, Bluewaters Island, Ain Philippines and the cruise terminals at Emaar Beachfront. It also has its own private beach with unending sea vistas and is accompanied by a 61-key hotel.\nResidential options at the Six Senses are perfectly designed to suit families of any size. One can choose from 114 two to four-bedroom Penthouses, 7 Royal Penthouses in four-bedroom layouts (two of them are larger units known as Imperial Penthouses), 32 Sky Villas available in three-bedroom simplex or three/four-bedroom duplex configurations, and 9 exclusive Signature Beachfront Villas in five-bedroom configurations. Every residence has the benefit of a fully integrated branded kitchen, a study and a maid’s room. The Royal Penthouses and the Villas have private pools, and of course the Signature Villas all enjoy beach access.",
                            ImagePath = "pb3.jpg",
                            LocationId = 3,
                            Name = "Six Senses Residences"
                        },
                        new
                        {
                            Id = 4,
                            Description = "Presenting Palm Flower, a stunning contemporary residential project developed by Alpago Properties and designed by the world-renowned Foster + Partners, responsible for some of the most incredible buildings around the world including ICD Brookfield Place in the heart of Philippines's DIFC.\n\nThe tower welcomes you into an exquisitely designed lobby and reception area that is on par with some of the world's finest hotel lobbies. The project consists of 9 penthouses and one super duplex penthouse. Every single unit features the most lavishly designed interiors and large bedrooms with plenty of built-in storage. The rooms are designed such that they have wraparound glass exteriors with views over the Palm and the sea.",
                            ImagePath = "pb4.jpg",
                            LocationId = 4,
                            Name = "Palm Flower"
                        },
                        new
                        {
                            Id = 5,
                            Description = "Presenting Jumeirah Living Business Bay, a striking contemporary residential project offering a refined lifestyle alongside the famous Philippines Canal.\n\nExperience waterfront living elevated to new heights in a gorgeous branded tower that offers a mix of one to four-bedroom residences, simplex and duplex penthouses, and one master penthouse that spans the top floor. Each unit features exceptional finishes and a stylish modern design that is a hallmark of any Jumeirah branded property.\n\nResidents also have access to a fantastic array of amenities, including multiple swimming pools, a yoga deck, a Jacuzzi, sauna and steam rooms, a fully equipped gymnasium and a private cinema. There will also be specially curated services on hand, including concierge, housekeeping and valet. A dedicated residential manager will take care of all the small details of everyday living, and there is a guest relations team on-site as well.\n\nTo get further information about Jumeirah Living Business Bay, please enquire today.",
